n = sample*6.283;
pi = 3.1415;
pi2 = 6.283;

phs = t1 + sample*9*bias;

bias = t5;
bias_i = bias - 1;

cc = phs / 3;
cc_int = int(cc);
cc_ramp = cc - cc_int;
cc_ad_a = (cc_ramp * bias - 1) / bias_i;
cc_ad_a = if( below(cc_ad_a,0) , 0 , cc_ad_a );

cc_ad_b = cc_ramp * bias;
cc_ad_b = if( above(cc_ad_b,1) , 1 , cc_ad_b );

cc_a = cc_ad_a + cc_int;
cc_b = (cc_ad_b + cc_int) ;

xp = t2 * above(cc_ad_a , 0);
yp = 1;
zp = 0;

ang = cc_a * 6.283 * 16;
sang = sin(ang) ; cang = cos(ang);
xq = sang*xp + cang*zp;
yq = yp;
zq = cang*xp - sang*zp;
xp=xq;yp=yq;zp=zq;

ang2 = cc_b + t4;
sang = sin(ang2) ; cang = cos(ang2);
xq = xp;
yq = sang*yp + cang*zp;
zq = cang*yp - sang*zp;
xp=xq;yp=yq;zp=zq;

ang2 = cc_b * 3.13 + t4;
sang = sin(ang2) ; cang = cos(ang2);
xq = sang*xp + cang*yp;
yq = cang*xp - sang*yp;
zq = zp;
xp=xq;yp=yq;zp=zq;

ang2 = cc_b * 1.43 + t4;
sang = sin(ang2) ; cang = cos(ang2);
xq = sang*xp + cang*zp;
yq = yp;
zq = cang*xp - sang*zp;
xp=xq;yp=yq;zp=zq;


zp = zp+3.1;
xs = xp/zp + 0.5;
ys = yp/zp * 1.333 + 0.5;

x=xs;
y=ys;

